[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "glycosmos", "sparql_query": "
SELECT (COUNT(DISTINCT ?site) AS ?count)
WHERE {
  ?site a ?type .
  FILTER(CONTAINS(STR(?type), "glycosylation") || CONTAINS(STR(?type), "site"))
}
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "glycosmos"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "glycosmos", "sparql_query": "PREFIX glycoconjugate: <http://purl.jp/bio/12/glyco/conjugate#>

SELECT (COUNT(DISTINCT ?site) as ?count)
FROM <http://rdf.glycosmos.org/glycoprotein>
WHERE {
  ?site a glycoconjugate:Glycosylation_Site .
}"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "ddbj"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX nuc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>

SELECT ?entry ?label ?bioproject
FROM <http://rdfportal.org/dataset/ddbj>
WHERE {
  ?entry a nuc:Entry ;
         dcterms:identifier "CP036276.1" ;
         rdfs:label ?label ;
         nuc:dblink ?bioproject .
  FILTER(CONTAINS(STR(?bioproject), "bioproject"))
}"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX ddbj: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>
PREFIX taxonomy: <http://ddbj.nig.ac.jp/ontologies/taxonomy/>

SELECT ?organism ?taxid
WHERE {
  ?entry a ddbj:Entry ;
         ddbj:accession "CP036276.1" ;
         ddbj:organism ?organism ;
         ddbj:taxid ?taxid .
}
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "ddbj"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX nuc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>
PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?label ?organism ?definition
FROM <http://rdfportal.org/dataset/ddbj>
WHERE {
  ?entry a nuc:Entry ;
         dcterms:identifier "CP036276.1" ;
         rdfs:label ?label ;
         nuc:organism ?organism .
  OPTIONAL { ?entry nuc:definition ?definition }
}"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "glycosmos", "sparql_query": "
PREFIX glycan: <http://purl.jp/bio/12/glyco/glycan#>
PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?epitope ?label ?description
WHERE {
  ?epitope a glycan:Glycoepitope ;
           rdfs:label ?label .
  OPTIONAL { ?epitope dcterms:description ?description }
  FILTER(REGEX(?label, "Lewis", "i"))
}
ORDER BY ?label
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "glycosmos"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "glycosmos", "sparql_query": "
PREFIX glycan: <http://purl.jp/bio/12/glyco/glycan#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT ?epitope ?label ?altLabel
FROM <http://rdf.glycoinfo.org/glycoepitope>
WHERE {
  ?epitope a glycan:Glycan_epitope ;
    rdfs:label ?label .
  ?label bif:contains "'Lewis'" option (score ?sc)
  OPTIONAL { ?epitope skos:altLabel ?altLabel }
}
ORDER BY DESC(?sc)
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "glycosmos", "sparql_query": "
PREFIX glycan: <http://purl.jp/bio/12/glyco/glycan#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
PREFIX glycoepitope: <http://www.glycoepitope.jp/epitopes/glycoepitope.owl#>

SELECT ?epitope ?label ?altLabel ?glycoseq ?antibody ?organism ?tissue
FROM <http://rdf.glycoinfo.org/glycoepitope>
WHERE {
  ?epitope a glycan:Glycan_epitope ;
    rdfs:label ?label .
  ?label bif:contains "'Lewis'" option (score ?sc)
  OPTIONAL { ?epitope skos:altLabel ?altLabel }
  OPTIONAL { ?epitope glycan:has_glycosequence ?glycoseq }
  OPTIONAL { ?epitope glycoepitope:has_antibody ?antibody }
  OPTIONAL { ?epitope glycoepitope:organism ?organism }
  OPTIONAL { ?epitope glycoepitope:tissue ?tissue }
}
ORDER BY DESC(?sc)
LIMIT 50
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "mediadive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?ingredient ?label ?chebi ?kegg ?pubchem ?cas ?formula
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?ingredient a schema:Ingredient ;
              rdfs:label ?label .
  OPTIONAL { ?ingredient schema:hasChEBI ?chebi }
  OPTIONAL { ?ingredient schema:hasKEGG ?kegg }
  OPTIONAL { ?ingredient schema:hasPubChem ?pubchem }
  OPTIONAL { ?ingredient schema:hasCAS ?cas }
  OPTIONAL { ?ingredient schema:hasFormula ?formula }
  FILTER(BOUND(?chebi) && BOUND(?kegg))
}
ORDER BY ?label
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT (COUNT(?ingredient) as ?count)
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
